function randomClassName(){	
	if(checkADS()){
		$img = 'data:image/jpeg;base64,';
	}else{
		$img = '/img/29.png';
	}
	$css = str_replace('{img}', $img, getTemplate('header'));
	$arr = ['header', 'main', 'content', 'side', 'footer', 'clear', 'link'];
	$result = [];
	foreach($arr as $val){
		$name = 'a'.mb_strtolower(genRandStr(rand(4, 8), 1));
		$css = str_replace('{'.$val.'}', $name, $css);
		$result["$val"] = $name;
	}
	$result['css'] = $css;
	return $result;
}

$xcss = randomClassName();

